import React from "react";
import { Navbar, Nav } from "react-bootstrap";
import styled from "styled-components";

const StyledSideNav = styled.div`
  position: fixed; /* Fixed Sidebar (stay in place on scroll and position relative to viewport) */
  height: 100%;
  width: 2.5%; /* Set the width of the sidebar */
  z-index: 1; /* Stay on top of everything */
  background-color: #212529; /* $gray-900 */
  overflow-x: hidden; /* Disable horizontal scroll */
  padding-top: 0%;
`;

const SideNav = () => {
  return (
    <div>
      <StyledSideNav>
        <Navbar
          expand="lg"
          defaultActiveKey="/home"
          className="flex-column"
          bg="dark"
          variant="dark"
          id="side-menu"
        > 
          {/* <Nav.Link href="/home"><h1><i class="bi bi-card-list"></i></h1></Nav.Link> */}
          <Nav.Link href="/home"><h1><i class="bi bi-house-fill bi-5x"></i></h1></Nav.Link>
          {/*Dashboard*/}
          <Nav.Link eventKey=""><h1><i class="bi bi-folder"></i></h1></Nav.Link>
          <Nav.Link eventKey=""><h1><i class="bi bi-files"></i></h1></Nav.Link>
          <Nav.Link eventKey=""><h1><i class="bi bi-currency-dollar"></i></h1></Nav.Link>
          <Nav.Link eventKey=""><h1><i class="bi bi-calendar3"></i></h1></Nav.Link>
          <Nav.Link eventKey=""><h1><i class="bi bi-bar-chart-line-fill"></i></h1></Nav.Link>
          <Nav.Link eventKey=""><h1><i class="bi bi-list-ul"></i></h1></Nav.Link>
        </Navbar>
      </StyledSideNav>
    </div>
  );
};

export default SideNav;
